import React from "react";
import Mcom_First_Fourth_Sem from "/faculty-of-commerce-website/src/pdf/M.com_First_to_Fourth_sem";
import Mcom_Fourth_Sem from "/faculty-of-commerce-website/src/pdf/Mcom_Fourth_Sem";


const Syllabus = () => {
    return (
        <div>
            <div className="container">
                <a role="button" className="btn btn-outline-primary" href={Mcom_First_Fourth_Sem}>
                    Bcom_First_Second_Sem
                </a></div><br />
            <div className="container">
                <a role="button" className="btn btn-outline-primary" href={Mcom_Fourth_Sem}>
                    Bcom_Third_Fourth_Sem
                </a></div><br />
        </div>
    );
};
export default Syllabus;
